"""
1. Отсортируйте по убыванию методом "пузырька" одномерный целочисленный массив,
заданный случайными числами на промежутке [-100; 100). Выведите на экран
исходный и отсортированный массивы. Сортировка должна быть реализована в
виде функции. Обязательно доработайте алгоритм (сделайте его умнее).

Идея доработки: если за проход по списку не совершается ни одной сортировки,
то завершение
Обязательно сделайте замеры времени обеих реализаций
и обосновать дала ли оптимизация эффективность

Подсказка: обратите внимание, сортируем не по возрастанию, как в примере,
а по убыванию
"""
from random import randint
from timeit import timeit
import cProfile, pstats


def bubble_sort(data: list):
    for itr in range(len(data)):
        for itr2 in range(len(data)-1):
            if data[itr2] < data[itr2+1]:
                tmp = data[itr2+1]
                data[itr2+1] = data[itr2]
                data[itr2] = tmp
    return data

def bubble_sort_2(data: list):
    dl = len(data)
    for itr in range(dl):
        chk = 0
        for itr2 in range(dl - 1):
            if data[itr2] < data[itr2+1]:
                tmp = data[itr2+1]
                data[itr2+1] = data[itr2]
                data[itr2] = tmp
                chk = 1
        if chk == 0:
            return data
# данную идею почерпнул из чётно-нечётной сортировки
def bubble_sort_3(data: list):
    dl = len(data)
    for itr in range(dl-1):
        if data[itr] < data[itr + 1]:
            tmp = data[itr + 1]
            data[itr + 1] = data[itr]
            data[itr] = tmp
        for itr2 in range(1, dl, 1):
            if data[itr2-1] < data[itr2]:
                tmp = data[itr2]
                data[itr2] = data[itr2-1]
                data[itr2-1] = tmp
    return data

test_data = [randint(-100, 100) for size in range(10000)]
print(test_data)

profiler = cProfile.Profile()
profiler.enable()
test1 = bubble_sort(test_data[:])
test2 = bubble_sort_2(test_data[:])
test3 = bubble_sort_3(test_data[:])
profiler.disable()
stats = pstats.Stats(profiler).sort_stats('tottime')
print('-'*100)
stats.print_stats()

if test1 == test2 == test3:
    print('True')
    print(test1)
else:
    print('False')
    print(test1)
    print(test2)
    print(test3)

